import React from 'react'
import data from '../data-mobile'

const Creations = () => {
  const [cards, setCards] = React.useState(data)

  return (
    <>
    <section>
      {cards.map((card) =>{
        const {id, image, title} = card
      })}
      return {
        <article key={id}>
          
          <img src="{image}" alt="creations card" />
          <h3>{title}</h3>
        </article>
      }
    </section>
    </>
  )
}

export default Creations
